define({"topics":[{"title":"English in the UK","shortdesc":"<p class=\"shortdesc\">Englishes in the UK are separated by isoglosses (geographical dialectal boundaries).         There has also been a 'Great Vowel Shift' that started in the 15th century.<\/p>","href":"englishes\/_c_uk.html","attributes":{"data-id":"c_uk"},"menu":{"hasChildren":false},"tocID":"c_uk-d627e639","next":"c_uk-d627e639"},{"title":"Irish English","shortdesc":"<p class=\"shortdesc\">Irish English comprises 3 dialectal areas.<\/p>","href":"englishes\/irish_english.html","attributes":{"data-id":"b1t5_irish_english"},"menu":{"hasChildren":false},"tocID":"b1t5_irish_english-d627e683","topics":[]},{"title":"American English","shortdesc":"<p class=\"shortdesc\">There is no single uniform dialect in America. Standard American English is the         standardized English. American Englishes can be divided into 5 major dialectal zones.         America has two well-known accents, the Boston and the New York accent. English in the West         has largely homogenized, whereas English along the coast varies. Immigrants (example         Italians in New York) have diversified English and accents.<\/p>","href":"englishes\/american_english.html","attributes":{"data-id":"b1t5_american_english"},"menu":{"hasChildren":false},"tocID":"b1t5_american_english-d627e694","next":"b1t5_american_english-d627e694"}]});